import { BrowserRouter, Route, Routes } from "react-router-dom";
import Inicio from "./pages/Início";
import SobreMim from "./pages/SobreMim";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Inicio/>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
